import NavSingle from "./NavSingle";

function Footer() {
    return (
        <div>
        <br></br>
            <ul>
                <NavSingle Title="Instagram" Link="../public/index.html" />
                <NavSingle Title="Twitter" Link="../public/index.html" />
            </ul>
        </div>
    );
}

export default Footer;
